import React from "react";
import './estilo.css';

export default function Topo(){
    return(
        <herader>
            <div>
                <img src="assets/barbearia-logo.png" alt="logomarca"/>
            </div>
            <div>
                <img src="assets/moon.png" alt="imagem da lua"/>
                <button>
                    Escuro</button>
            </div>
        </herader>
    );
}
